import logo from './logo.svg';
import './App.css';

function App() {
  const x = 5;
  let text = "goodbye"
  text = x < 10 ?"hello world" : text
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>react is {190*10} men {text}</h1>

      </header>
    </div>
  );
}

export default App;
